// MyComponent.js

import React, { useState, useEffect } from 'react';
import axios from 'axios';

const MyComponent = () => {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async () => {
        try {
            const response = await axios.get('/api/get_data/');  // Django API'sini çağır
            setData(response.data);  // Gelen veriyi React durumuna set et
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    return (
        <div>
            <h1>My Data</h1>
            <ul>
                {data.map((item, index) => (
                    <li key={index}>{item.field_name}</li>  // Verinin hangi alanını kullanmak istiyorsanız onu belirtin
                ))}
            </ul>
        </div>
    );
};

export default MyComponent;
